**How it works**

1. The user clicks the extension's icon in the browser toolbar, which opens the popup.
2. The popup contains a button labeled "Take Screenshot".
3. When the user clicks the button, the extension uses the `chrome.tabs.captureVisibleTab` method to capture the visible area of the current tab as a PNG image.
4. The extension creates a new link element with the captured image data as its `href` attribute.
5. The extension simulates a click on the link, which downloads the screenshot as a PNG file named "screenshot.png".

**Example use case**

1. Open a new tab and navigate to a webpage you want to take a screenshot of.
2. Click the extension's icon in the browser toolbar to open the popup.
3. Click the "Take Screenshot" button in the popup.
4. The screenshot will be downloaded as a PNG file named "screenshot.png".

