```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello, ${answer}!`);
  rl.close();
});
```
This code creates a `readline` interface that reads input from the standard input (`process.stdin`) and writes output to the standard output (`process.stdout`). The `question` method is used to prompt the user to enter their name, and the callback function is called with the user's response as an argument.

