Here are a few popular compiler optimization techniques, along with examples in C++:

### 1. Dead Code Elimination

Dead code elimination is a technique where the compiler removes code that does not affect the program's output.

**Example:**
```cpp
int foo(int x) {
    int y = x * 2; // dead code
    return x;
}
```
In this example, the variable `y` is assigned a value, but it is never used. A compiler optimizing for dead code elimination would remove the line `int y = x * 2;`.

### 2. Constant Folding

Constant folding is a technique where the compiler evaluates constant expressions at compile-time.

**Example:**
```cpp
int foo() {
    int x = 2 + 3; // constant expression
    return x;
}
```
In this example, the expression `2 + 3` is a constant expression that can be evaluated at compile-time. A compiler optimizing for constant folding would replace the expression with its result, `5`.

### 3. Copy Elision

Copy elision is a technique where the compiler eliminates unnecessary copies of objects.

**Example:**
```cpp
class MyClass {
public:
    MyClass(int x) : x_(x) {}
    MyClass(const MyClass& other) : x_(other.x_) {} // copy constructor

private:
    int x_;
};

MyClass foo() {
    return MyClass(5); // copy elision
}
```
In this example, the `foo()` function returns a `MyClass` object by value. Without copy elision, the compiler would create a temporary object and then copy it to the return value. With copy elision, the compiler constructs the return value directly, eliminating the unnecessary copy.

### 4. Loop Unrolling

Loop unrolling is a technique where the compiler increases the number of iterations in a loop to reduce the overhead of loop control statements.

**Example:**
```cpp
int foo(int* arr, int n) {
    int sum = 0;
    for (int i = 0; i < n; i++) {
        sum += arr[i];
    }
    return sum;
}
```
In this example, the loop iterates `n` times. A compiler optimizing for loop unrolling might unroll the loop to iterate `n/4` times,

